    // 'eol' - служебное слово, помечающее, что конец строки. А если конец строки, то все
    printToRow(text, rownum, rowwidth, fontsize) {
        let str = "";
        let lettersperrow = rowwidth / fontsize;
        let passedLetters = 0;
        let currentRow = 1;
        let words = text.split(' ');
        let acceptedWords = new Array();
        let end = false;
        words.forEach(w => {
            if (!end) {
                passedLetters = passedLetters + w.length;
                if ((passedLetters > lettersperrow || w.startsWith('eol')) && passedLetters > 0 && passedLetters != w.length) {
                    if (currentRow == rownum) {
                        end = true;
                    }
                    else {
                        passedLetters = 0; // обнуляем счетчик
                        passedLetters = passedLetters + w.length; // снова засовываем то что не вошло в него
                        currentRow += 1; // переходим на следующую строку.
                        if (currentRow == rownum && !w.startsWith('eol')) {
                            acceptedWords.push(w);
                        }
                    }
                }
                else {
                    if (currentRow == rownum && !w.startsWith('eol')) {
                        acceptedWords.push(w);
                    }
                    else {
                    }
                }
            }
        });
        acceptedWords.forEach(aw => str = str + aw + " ");
        return str;
    }
    /**
     * Делит текст на строки. Не воспринимает конец строки.
     * @param text
     * @param rownum
     * @param rowwidth
     * @param fontsize
     */
    splitTextByRows(text, rowwidth, fontsize) {
        let rows = new Array();
        let str = ""; // current row
        let lettersperrow = rowwidth / fontsize;
        let passedLetters = 0;
        let words = text.split(' ');
        let acceptedWords = new Array();
        words.forEach(w => {
            passedLetters = passedLetters + w.length;
            if (passedLetters > lettersperrow && passedLetters > 0 && passedLetters != w.length) {
                passedLetters = 0; // обнуляем счетчик
                acceptedWords.forEach(aw => str = str + aw + " ");
                acceptedWords = new Array(); // очищаем слова на строке.
                rows.push(str); // засовываем заполненную строку.
                str = ""; // Очищаем строку
                passedLetters = passedLetters + w.length; // снова засовываем то что не вошло в него
                acceptedWords.push(w); // идет в новую строку
            }
            else {
                acceptedWords.push(w);
            }
        });
        acceptedWords.forEach(aw => str = str + aw + " ");
        rows.push(str); // засовываем остатки строки.
        return rows;
    }
    /**
     * Принимается массив колонок с eol. Выдается массив колонок с eol,
     * @param inputRows
     */
    prepareTableRows(inputRows, rowwidth, fontsize) {
        let output = new Array();
        let tempArray = new Array();
        let index = 0;
        inputRows.forEach(s => {
            let tempElement = s.split(' eol ');
            tempArray.push(tempElement);
            //tempArray[index] = 
            index++;
        });
        if (tempArray.length > 0) {
            for (let n = 0; n < tempArray[0].length; n++) {
                let maxRows = 0;
                for (let i = 0; i < tempArray.length; i++) {
                    let subrows = this.splitTextByRows(tempArray[i][n], rowwidth[i], fontsize);
                    let recordLength = subrows.length; // Получаем длину записи.
                    if (recordLength > maxRows) {
                        maxRows = recordLength; // Находим самую длинную запись , чтобы все записи с остальных столбцов, относящиеся к этой, подстроились под нее
                    }
                }
                for (let i = 0; i < tempArray.length; i++) {
                    let subrows = this.splitTextByRows(tempArray[i][n], rowwidth[i], fontsize);
                    let recordLength = subrows.length; // Получаем длину записи.
                    if (maxRows > recordLength) {
                        let difference = maxRows - recordLength;
                        for (let d = 0; d < difference; d++) {
                            tempArray[i][n] = tempArray[i][n] + " eol "; // Добавляем недостающую запись
                        }
                    }
                }
            }
            let str = "";
            for (let i = 0; i < tempArray.length; i++) {
                str = "";
                for (let n = 0; n < tempArray[i].length; n++) {
                    str = str + tempArray[i][n] + " eol ";
                }
                output.push(str);
            }
        }
        return output;
    }
