    /**
     * Определяем, выводить день, дня или дней
     * @param count
     */
    getDayString(count) {
        let lastLetter = Number.parseInt(count.toString().slice(-1));
        if (count > 10 && count < 21) {
            return "дней";
        }
        else if (lastLetter == 1) {
            return "день";
        }
        else if (lastLetter > 1 && lastLetter < 5) {
            return "дня";
        }
        else {
            return "дней";
        }
    }
    /**
     * Определяем, выводить месяц, месяца или месяцев
     * @param count
     */
    getMonthString(count) {
        let lastLetter = Number.parseInt(count.toString().slice(-1));
        if (count > 10 && count < 21) {
            return "месяцев";
        }
        else if (lastLetter == 1) {
            return "месяц";
        }
        else if (lastLetter > 1 && lastLetter < 5) {
            return "месяца";
        }
        else {
            return "месяцев";
        }
    }
