    beautifyDate(date) {
        date = date.slice(0, 10);
        //return date;
        if (date.length == 0) {
            return "";
        }
        let parts = date.split("-");
        if (parts.length != 3) {
            return "";
        }
        return parts[2] + "." + parts[1] + "." + parts[0];
    }
